import React from "react";
import Layout from "../../Containers/Layout";
import styles from './profile.module.scss';
import 'antd/dist/antd.css';
import {UserOutlined, MailOutlined, LockOutlined, PhoneOutlined, ScheduleOutlined, getTwoToneColor} from '@ant-design/icons';
import { Tabs, Card, Button, Row, Col} from 'antd';

const { TabPane } = Tabs;

const content = (props) => console.log(props) || (
        <div className={styles.titlu}> Profilul meu:
        <Tabs>
            <TabPane className={styles.continut0} tab="Contul meu" key="1" active>
            <p>Nume: </p>
            <p>Prenume: </p>
            <p>Email: </p>
            <p>Parola: </p>
            <p>Nume utilizator: </p>
            </TabPane>
            <TabPane className={styles.continut} tab="Resurse" key="2" active>
                <div>
                <Row gutter={16}>
                    <Col span={6}>
                        <Card title={<span className={styles.continut}>Resursa 1  
                            <button
                                variant="contained"
                                className={styles.button}
                                size={'large'}
                                // onClick={() => handleLogin()}
                            >
                                <p>REZERVA</p>
                            </button>
                        </span>} className={styles.continut2} bordered={true} style={{ width: 300 }} activeTabKey>
                        <p>Status:</p>
                        <p>Timp:</p>
                        </Card>
                    </Col>
                    <Col span={6}>
                        <Card title={<span className={styles.continut}>Resursa 2  
                            <button
                                variant="contained"
                                className={styles.button}
                                size={'large'}
                                // onClick={() => handleLogin()}
                            >
                                <p>REZERVA</p>
                            </button>
                        </span>} className={styles.continut2} bordered={true} style={{ width: 300 }} activeTabKey>
                        <p>Status:</p>
                        <p>Timp:</p>
                        </Card>
                    </Col>
                    <Col span={6}>
                        <Card title={<span className={styles.continut}>Resursa 3  
                            <button
                                variant="contained"
                                className={styles.button}
                                size={'large'}
                                // onClick={() => handleLogin()}
                            >
                                <p>REZERVA</p>
                            </button>
                        </span>} className={styles.continut2} bordered={true} style={{ width: 300 }} activeTabKey>
                        <p>Status:</p>
                        <p>Timp:</p>
                        </Card>
                    </Col>
                    <Col span={6}>
                        <Card title={<span className={styles.continut}>Resursa 4 
                            <button
                                variant="contained"
                                className={styles.button}
                                size={'large'}
                                // onClick={() => handleLogin()}
                            >
                                <p>REZERVA</p>
                            </button>
                        </span>} className={styles.continut2} bordered={true} style={{ width: 300 }} activeTabKey>
                        <p>Status:</p>
                        <p>Timp:</p>
                        </Card>
                    </Col>
                    <Col span={6}>
                        <Card title={<span className={styles.continut}>Resursa 5 
                            <button
                                variant="contained"
                                className={styles.button}
                                size={'large'}
                                // onClick={() => handleLogin()}
                            >
                                <p>REZERVA</p>
                            </button>
                        </span>} className={styles.continut2} bordered={true} style={{ width: 300 }} activeTabKey>
                        <p>Status:</p>
                        <p>Timp:</p>
                        </Card>
                    </Col>
                </Row>
                </div>
            </TabPane>
        </Tabs>
        </div>

);

const Profile = () => {
    return (
        <Layout content={content}/>
    )
};
export default Profile;
